import React from 'react';
import ElementList from '../ElementList/ElementList';
import './sidebar.css';

const Sidebar = () => {
  return (
    <div className="Sidebar">
      <div className="Sidebar__header">BLOCKS</div>
      <ElementList className="Sidebar__elementList"/>
    </div>
  );
};

export default Sidebar;
